import React from 'react'
import * as S from './styled.js'

const RepositoryItem = ({name, linkToRepo, fullName}) => {
  return (
    <S.Wrapper>
        <div>
            <h2>{name}</h2>
            <h4>full name:</h4>
            <a  href={linkToRepo} target="_blank"  rel="noreferrer">
                {fullName} 
            </a>
        </div>
    </S.Wrapper>   
  )
}

export default RepositoryItem;
